// generate random integer // DEBUG
function getRandomInt(max) {
    return Math.floor(Math.random() * Math.floor(max));
}

// remap value to new max (percent)
function remap(value, value_max, new_velue_max) {
    let new_value = (value / value_max) * new_velue_max;
    return new_value;
}

// set up districts from region
function setUpDistricts(region, ids)
{
    let i = 0;
    for(var r in region) {

        let district = region[r];

        district.attr(style);
        district.node.id = ids[i];
        i++;

        district[0].addEventListener("mouseover", function() {
            district.animate(hoverStyle, animationSpeed);
        }, true);

        district[0].addEventListener("mouseout", function() {
            district.animate(style, animationSpeed);
        }, true);

        district[0].onclick = function(event) {
            let found = false;
            for(entry in incidence_data){
                if(incidence_data[entry][0] === event.target.id){

                    // update data graph
                    RegionChange(event.target.id);
                    // update map circles
                    updateCircles(group, getDate());

                    found = true;
                    break;
                }
            }
            if(!found){
                console.log("ERROR: Clicked on " + event.target.id + " but ID was not found!");
            }
        };
    }
}

// function deletes all currently drawn incidence circles
function deleteCircles(circles){
    for(var i = 0; i < circles.length; i++){
        circles[i][0].remove();
    }
    circles = [];
}

// draws new incidence circles with the correct data
//#region @params
///@param: <paper> <paper to draw on>
///@param: <regions> <regions array within to center the circles>
///@param: <circles> <circles array for the specified regions array to store new circles and to prohibit doublication>
///@param: <ids> <ids array for specified region to be able to search for the correct data>
///@param: <group> <people group for which to search data>
///@param: <day> <day for which to search data>
///@param: <transform> <transform property of region to match style>
///@param: <translate> <translate property of region to match style>
//#endregion
function drawCircles(paper, regions, circles, ids, group, day, transform, translate){
    //console.log(r.attr('path').toString()); // DEBUG

    // make sure all old circles are deleted to avoid double drawing
    deleteCircles(circles);

    // draw one circle for each region
    let i = 0;
    for(var regionID in regions) {
        let r = regions[regionID];

        // get region center point
        let dims = Raphael.pathBBox(r.attr('path').toString());
        let getw = dims.width;
        let geth = dims.height;
        let getx = dims.x;
        let gety = dims.y;
        let centerx = getx + getw / 2;
        let centery = gety + geth / 2;

        // get incedence data
        let group_percent = 0;
        let incidence = 0;
        for(var entry in incidence_data){

            if(incidence_data[entry][0] === ids[i].toString()){
                group_percent = incidence_data[entry][2][group]; // people in "group" in % ("0" would be people in total)
                incidence = incidence_data[entry][3][day][0]; // "day" total incidence in %
                break;
            }
        }
        // select next id
        i++;

        //#region  Styling // TODO & WIP

        // people percent floor at (0.25) for circle color purposes // Hier Flo als Mathe Experten fragen TODO
        group_percent = group_percent - 0.25;
        if(group_percent < 0){
            group_percent = 0;
        }
        // brings people percent into color range
        var remapped_group_percent = remap(group_percent, 0.16, 255); // estimate max percent (0.41) - new floor (0.25) = new max (0.16) | max found = Suhl (0.4071)

        // incidence caps at (500) for circle size purposes
        var remapped_incidence = 0;
        if(incidence > 308){
            remapped_incidence = (incidence/15)+120;
        }
        else{
            remapped_incidence = 8*Math.sqrt(incidence);
        }

        // initiate circle
        let circle = paper.circle(centerx, centery, 23 * (remapped_incidence/140)); // 50 => max circle size
        // translate style
        let circle_style = {
            "stroke": "#ff0000", // red
            "fill": "rgba(" + (255 - remapped_group_percent) +  ", " + (255 - remapped_group_percent) + ", 255, 0.66)" // white (young) to blue (old) => black circles are errors in data
        };
        circle.attr(circle_style);
        circle.transform(transform);
        circle.translate(translate[0], translate[1]);
        // make sure the mouse events are passed through
        circle.node.setAttribute("pointer-events", "none");
        circles.push(circle);

        //#endregion
    }
}

